Eind 1941 arriveert geheim agent Paul Soames (John Cusack) in het Chinese Shanghai om de moord op een bevriende collega te onderzoeken. De stad is bijna helemaal in handen van de Japanners en de onderlinge spanning is voelbaar. Om de zaak op te lossen moet Paul diep in de mysterieuze wereld van de lokale machthebbers duiken, maar zonder vijanden te maken. Dat laatste lijkt onmogelijk te worden als Paul een verhouding krijgt met Anna (Gong Li), de vrouw van een machtige Chinese gangsterbaas.

